import { Parallax } from 'react-parallax';
import IphoneParallax from '../pic/iphone.jpg'

const IphonePar = () => (
    <Parallax className="image" bgImage={IphoneParallax} strength={800}>
        <div className="content">
            <span className="img-txt"> Lorem ipsum dolor sit amet,
                consectetur adipisicing elit. Ab alias architecto,
                ducimus enim facilis itaque quis voluptas?
                Aperiam, harum, provident. </span>
        </div>
    </Parallax>
);

export default IphonePar
